css:
body {
  font-size: 12px;
  color: #a8a8a8;
  background-color: #ffffff;
}
atom-pane {
  border-right: 1px solid #ededed;
}
atom-pane:last-child {
  border-right: none;
}
.block.section-heading.icon.icon-code {
  font-weight: normal;
}
.settings-view .setting-title {
  font-weight: normal;
}
.settings-view .sub-section .sub-section-heading {
  font-weight: normal;
}
.setting-description {
  font-weight: normal;
}
.setting-description.text.theme-description {
  display: none;
}
.btn {
  color: #b8b8b8;
  background-color: white;
}
.btn:hover,
.btn:focus {
  color: #0086b3;
  background-color: white;
}
.btn:active {
  color: rgba(167, 29, 93, 0.66);
  background-color: #fafafa;
}
.btn.selected {
  color: #a71d5d;
  background-color: #ffffff;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #a71d5d;
  background-color: white;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  color: #0086b3;
}
.btn.btn-primary:active {
  background-color: #6f5596;
}
.btn.btn-primary.selected {
  background-color: #846aaa;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #8f77b2;
}
.btn.btn-info {
  color: #a71d5d;
  background-color: white;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  color: #0086b3;
}
.btn.btn-info:active {
  background-color: #6f5596;
}
.btn.btn-info.selected {
  background-color: #846aaa;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #8f77b2;
}
.btn.btn-success {
  color: #a71d5d;
  background-color: white;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  color: #0086b3;
}
.btn.btn-success:active {
  background-color: #188b65;
}
.btn.btn-success.selected {
  background-color: #1fad7e;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #22bf8a;
}
.btn.btn-warning {
  color: #a71d5d;
  background-color: white;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  color: #0086b3;
}
.btn.btn-warning:active {
  background-color: #bc7a2f;
}
.btn.btn-warning.selected {
  background-color: #d08e43;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #d49854;
}
.btn.btn-error {
  color: #a71d5d;
  background-color: white;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  color: #0086b3;
}
.btn.btn-error:active {
  background-color: #c72323;
}
.btn.btn-error.selected {
  background-color: #dc3838;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #df4949;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: black;
  border-radius: 2px;
  background-color: #ffffff;
  border: 1px solid #e6e6e6;
}
atom-text-editor[mini].is-focused {
  background-color: #f2f2f2;
}
atom-text-editor[mini] .placeholder-text,
atom-text-editor[mini]::shadow .placeholder-text {
  color: #cccccc;
}
atom-text-editor[mini] .selection .region,
atom-text-editor[mini]::shadow .selection .region {
  background-color: #f2f2f2;
}
.find-and-replace {
  border-top: 1px solid #ededed;
}
.status {
  color: #a8a8a8;
}
.status-added {
  color: #73c990;
}
.status-ignored {
  color: #000000;
}
.status-modified {
  color: #e2c08d;
}
.status-removed {
  color: #ff6347;
}
.status-renamed {
  color: #1ba39c;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #ffffff;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #a71d5d;
  background-color: #f2f2f2;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #a71d5d;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #ffffff;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.panel-heading {
  border-bottom: 1px solid #ededed;
  background-color: #ffffff;
}
.inset-panel {
  background-color: #ffffff;
}
.inset-panel .panel-heading {
  background-color: #ffffff;
}
atom-panel.modal {
  border: 1px solid #ededed;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #d831b0;
}
.ui-site-5 {
  background-color: #ebdd5b;
}
.status-bar {
  font-size: 12px;
  color: #a8a8a8;
  border-top: 1px solid #ededed;
  background-color: #ffffff;
}
.tab-bar {
  background-color: #ffffff;
  border-bottom: 1px solid #ededed;
}
.tab-bar .tab {
  color: #a8a8a8;
  height: 30px;
  line-height: 30px;
  font-size: 12px;
  border-right: 1px solid #ededed;
}
.tab-bar .tab.active {
  color: #a71d5d;
  border-bottom: 2px solid #0086b3;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #1ba39c;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #a71d5d;
}
.tab-bar .tab.active .close-icon:hover {
  color: #a8a8a8;
}
.tab-bar .tab.is-dragging {
  background: #e6e6e6;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #000000;
}
.text-highlight {
  color: #0086b3;
}
.text-info {
  color: #1ba39c;
}
.text-success {
  color: #73c990;
}
.text-warning {
  color: #e2c08d;
}
.text-error {
  color: #ff6347;
}
.highlight {
  padding: 1px 4px;
  color: #0086b3;
  border-radius: 2px;
  background-color: #f2f2f2;
}
.highlight-info {
  padding: 1px 4px;
  color: #0086b3;
  border-radius: 2px;
  background-color: #e6f9ff;
}
.highlight-warning {
  padding: 1px 4px;
  color: #0086b3;
  border-radius: 2px;
  background-color: #cc8533;
}
.highlight-error {
  padding: 1px 4px;
  color: #0086b3;
  border-radius: 2px;
  background-color: #d92626;
}
.highlight-success {
  padding: 1px 4px;
  color: #0086b3;
  border-radius: 2px;
  background-color: #1c9c71;
}
.background-message {
  color: #000000;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #a71d5d;
  background: #f2f2f2;
}
.tree-view-resizer {
  border-right: 1px solid #ededed;
}
.tree-view {
  color: #a8a8a8;
  background-color: #ffffff;
}
.tree-view .list-item.selected {
  color: #a71d5d;
}
